<br><br><br><br><br><br><br><strong>Welcome to Interleave</strong><br><br><br>
Interleave was founded in 2001 to have a better administration on a department of a<br>
multinational company in which tasks came in, had to be handled, and went out to the<br>
next department.<br><br>
Started as a simple web administration tool called CRM-CTT, it now is a multi-lingual<br>
workflow, interface and web-publishing application used by thousands of businesses all<br>
over the world.<br><br>
Enjoy using Interleave!<br><br>
